import React from "react";
import { Navigate } from "react-router-dom";

const ProtectedRoute = (props) => {

    let auth = true;
    if(!auth){
        Navigate
    }

    return (
        <div>
            {props}
        </div>
    )
}

export default ProtectedRoute;
